import styled from 'styled-components';
import React from "react";

const SiteContentStyled = styled.div`
  flex-grow: 1;
  height: 100%;
  display: flex;
  flex-direction: row;
`;

export const SiteContent: React.FunctionComponent = (props) => (
  <SiteContentStyled>
    {props.children}
  </SiteContentStyled>
);
